import React from 'react';
// import './Art.css';

const Art = () => {
    return (
        <div className="Art">
            <text>ART PAGE</text>
            <button type="button"><a href="/about">About</a></button>
            <button type="button"><a href="/projects">Projects</a></button>
            <button type="button"><a href="/art">Art</a></button>
            <button type="button"><a href="/resume">Resume</a></button>
        </div>   
    )
};

export default Art;
